import Card from './Card';

export default function Cards(props) {
   return (
      <div>
         {  
            props.characters.map((personaje) => {

               return (
                  <li>
                     <Card
                        key={personaje.id}
                        name={personaje.name}
                        status={personaje.status}
                        gender={personaje.gender}
                        origin={personaje.origin}
                        image={personaje.image}
                     />
                  </li>
               )
            })

         }
      </div>
   )
}
